B.UH=new A.Q(B.Vn,["Young Platform","Exchange di criptovalute per l'acquisto e vendita di asset oltre che strumenti di investimento.\nLe principali sfide affrontate nel suo sviluppo includono il mantenimento di un ambiente di produzione costantemente aggiornato e privo di bug, la gestione di una vasta base di utenti, la garanzia di misure di sicurezza robuste e la gestione delle informazioni personali.","AliraHealth: MyReco","Questo progetto mira a fornire un'esperienza personalizzata per i pazienti che partecipano a studi clinici.\n\xc8 stato sviluppato durante la mia esperienza in AliraHealth.\nEra composto da un paio di Frontend in Flutter e un'architettura di microservizi sul backend.","App StarTy","Piattaforma di crowdfunding dedicata agli investimenti in startup e aziende tramite criptovalute e blockchain.\nMi sono occupato di costruire l'applicazione frontend utilizzando Flutter.\nAbbiamo utilizzato le funzioni di Firebase per interagire con i contratti blockchain.","Game of life","Questo progetto \xe8 un'implementazione del famoso gioco di Conway.","PatchAii: Flutter Starter Project","Template di avvio a cui io e i miei colleghi di AliraHealth abbiamo contribuito prima di iniziare il progetto aziendale.\nContiene la gestione dello stato, il modello di funzioni di generazione automatica, il routing, le traduzioni di base, le notifiche di base.","Todo DAPP","Questo progetto \xe8 un'applicazione mobile di base Todo costruita con Flutter.\nIl backend consiste in un contratto Solidity che gira sulla blockchain Ethereum.","Goak","Modulo Go per costruire un albero decisionale da un file Json ed eseguire una ricerca attraverso di esso.","Telegram Scraper","Script Python per estrarre gli utenti di telegram da un gruppo e spostarli in un altro.","Instagram ADB Bot","Aura box","Flutter widget per combinare moteplici gradienti radiali e effetti di blur."],t.w)
B.Tb=new A.Q(B.y8,["Lorenzo Gangemi","Home","Progetti","Carriera","Timeline","Pagina non trovata","Tecnologie","La maggior parte della mia esperienza riguarda lo sviluppo mobile, ma sono sempre stato appassionato di qualsiasi cosa fosse innovativo.\nRecentemente trascorro la maggior parte del mio tempo programmando in Flutter e Golang, ma quando posso mi dedico a Solidity e sviluppo di smart contracts. \ud83d\udcf1\ud83d\udcbb","Sviluppatore Mobile e Web con sede in Italia!","Ciao! Sono Lorenzo \ud83d\udc4b","Ingegnere Software, RedBull.","Bio","Software engineer specializzato in app mobile e sistemi distribuiti.\nAttualmente ricopro la posizione di Mobile Software Engineer presso RedBull.","Vai","Luminosit\xe0","Curriculum","Live","Source code","Pub.dev","Esperience professionali","Educazione","Progetti Professionali","Progetti Open Source",B.xV,B.Te,B.UH],t.yf)
